class HP_gauge {
  constructor(_x,_y,_xsiz,_ysiz){
    this.maxhp = 100;
    this.hp = this.maxhp;
    this.delta_hp =  0.2;//変化量
    this.x = _x;this.y = _y;this.xsiz = _xsiz;this.ysiz = _ysiz;
  }

  draw(){
    //外枠
    fill(200);
    rect(this.x,this.y,this.xsiz,this.ysiz);
    //中身 
    let length = this.ysiz * this.hp/this.maxhp;
    if(this.hp >= 0){
      fill(32,223,128);
      rect(this.x,this.y + this.ysiz - length,this.xsiz,length);
    }
  }

  update(x){
    this.hp += x * this.delta_hp;
    if(this.hp > 100){this.hp = 100;}
    if(this.hp < 0){this.hp = 0;}
  }
  
}

class Oxgen_gauge{
  constructor(_x,_y,_xsiz,_ysiz){
    this.max_oxgen = 100;
    this.oxgen = this.max_oxgen;
    this.delta_oxgen = 0.1;
    this.x = _x;this.y = _y;this.xsiz = _xsiz;this.ysiz = _ysiz;
  }

  draw(){
    //外枠
    fill(200);
    rect(this.x,this.y,this.xsiz,this.ysiz);
    //中身 
    let length = this.ysiz * this.oxgen/this.max_oxgen;
    if(this.oxgen >= 0){
        fill(0,255,255);
        rect(this.x,this.y + this.ysiz - length,this.xsiz,length);
    }
  }

  update(x){
    this.oxgen += x * this.delta_oxgen;
    if(this.oxgen > 100)this.oxgen = 100;
    if(this.oxgen < 0)this.oxgen = 0;
  }

}

class Coins{
  constructor(_x,_y,_d){
    this.coincnt = 1;
    this.x = _x;this.y = _y;this.d = _d;
  }
  draw(){
    for(let i = 0;i < this.coincnt;i++){
      fill(255,230,0);
      // circle(this.x ,this.y - (this.d + 3)*i,this.d);
      image(coinimg,this.x,this.y - (this.d + 3)*i,this.d,this.d);
    }
  }
}

const landstate = {
  tree : "tree",
  fire : "fire", 
  field :"field" ,
}

class Land{
  constructor(_minx,_maxx,_miny,_maxy){
    this.minx = _minx;
    this.maxx = _maxx;
    this.miny = _miny;
    this.maxy = _maxy;
    this.state = null;
  }

  position(){
    let minx = this.minx;let maxx = this.maxx;
    let miny = this.miny;let maxy = this.maxy;
    return {minx,maxx,miny,maxy};
  }

}

class Tree extends Land{
  constructor(_minx,_maxx,_miny,_maxy,_c){
    super(_minx,_maxx,_miny,_maxy);
    this.state = landstate.tree;
    this.c = _c;//係数
    this.level = 1;
    this.needpoint = 1000;
    this.nowpoint = 0;
    this.maxlevel = 3;
  }

  stateupdate(){
    if(this.level == this.maxlevel)return false;
    this.nowpoint += 5 * this.c;
    if(this.nowpoint >= this.needpoint){
      this.nowpoint = 0;
      this.level+= 1;
    }
    return false;
  }
  
}

class Fire extends Land{
  constructor(_minx,_maxx,_miny,_maxy,_c,_sml){
    super(_minx,_maxx,_miny,_maxy);
    this.state = landstate.fire;
    this.level = _sml;// 1->S,1->2,2->3
    this.c = _c;//係数
    this.nowpoint = 0;
    this.needpoint = 100;
  }
  
  stateupdate(){
    //bool返す
    this.nowpoint += this.c * 1;
    return this.nowpoint >= this.needpoint ? true: false;
  }
}

class Field extends Land{
  constructor(_minx,_maxx,_miny,_maxy,_c){
    super(_minx,_maxx,_miny,_maxy);
    this.state = landstate.field;
    this.c = _c;//係数
    this.level = 1;
    this.needpoint = 1000;
    this.nowpoint = 0;
    this.maxlevel = 3;
    //収穫(コインを増やす用)
    this.harvestpoint = 0;
    this.harvestable = 500;
  }

  stateupdate(){
    this.harvestpoint += 1 * (this.maxlevel +0.5 - this.level);
    if(this.level == this.maxlevel)return false;
    this.nowpoint += 2 * this.c;
    if(this.nowpoint >= this.needpoint){
      this.nowpoint = 0;
      this.level+= 1;
    }
    return false;
  }
}

class LandsArea{
  //畑とかがあるところ(figmaの背景が白になっている部分の中)
  constructor(windowW,windowH){
    this.landsH = windowH * 4/5;//土地があるエリアの横幅
    this.landsW = windowW * 900/1250;//土地があるエリアの縦の長さ
    this.lands_left_top_y = windowH /10;
    this.lands_left_top_x = windowW *300/1250;
    this.xnum = 3;
    this.ynum = 2;//土地は横に3つ、縦に2つ

    this.landsiz = windowH  * 7/24;//土地の縦と横の長さ
    this.land_mergin_x = (this.landsW - 3 * this.landsiz)/2;
    this.land_mergin_y = (this.landsH - 2 * this.landsiz)/3;
  
  }
  land_place_info(i,j){
    //i行目j列の畑の位置のminx,maxx,miny,maxyを返す.i,jは0indexed
    let minx = this.lands_left_top_x + this.land_mergin_x + j * this.landsiz;
    let maxx = this.lands_left_top_x + this.land_mergin_x + (j+1) * this.landsiz;
    let miny = this.lands_left_top_y + this.land_mergin_y * (i+1) + i * this.landsiz;
    let maxy = this.lands_left_top_y + this.land_mergin_y * (i+1) + (i+1) * this.landsiz;
    return {minx,maxx,miny,maxy};
  }
}


let canvas;
let lands_area;
// let minx,maxx,miny,maxy;//森林農地部分の指定 LandsAreaによって不要になったはず
let xnum,ynum;//森林農地を何分割するか
// let landxsiz = 0,landysiz = 0;
let lands = [];//土地情報
let hp,oxgen,coins;
let started = false;
let isfinish = false;

let news_type = "none";
let starttime,endtime;
let coin_tutrial = true;//tutrialをやる必要があるか
let planting_tutrial = true;
let fire_tutrial = true;


function setup(){
  canvas = createCanvas(float(windowWidth) * 3/4, float(windowWidth) *3/4 * 3/5);
  background(100);
  lands_area = new LandsArea(width,height);
  ynum = lands_area.ynum;
  xnum = lands_area.xnum;
}

function land_init(){
  //土地の状態を初期化する
  for(let i = 0;i < ynum;i++){
    lands[i] = [];
    for(let j = 0;j < xnum;j++){
      let pos = lands_area.land_place_info(i,j);
      if((i + j) % 2 == 0){
        lands[i][j] = new Tree(pos.minx,pos.maxx,pos.miny,pos.maxy,1);
        lands[i][j].level += 1;
      }else{
        lands[i][j] = new Field(pos.minx,pos.maxx,pos.miny,pos.maxy,1);
      }
    }
  }
}

function restart(){
  //リスタート
  hp = new HP_gauge(width/100,height/3,width/20,height/2);
  oxgen = new Oxgen_gauge(width/12,height/3,width/20,height/2);
  coins = new Coins(width/6,height/2 + height/3,width/30);
  land_init();
  isfinish = false;
  starttime = millis();
  coin_tutrial = true;planting_tutrial = true;fire_tutrial = true;
}


function hpupdate(){
  hp.update(-1);
}

function oxgenupdate(){
  //森の状態を利用して酸素ゲージを増減させる
  let treelevel_sum = 0;
  for(let i = 0;i < ynum;i++)for(let j = 0;j < xnum;j++){
    if(lands[i][j].state == landstate.tree){
      treelevel_sum += lands[i][j].level;
    }
  }
  oxgen.update(treelevel_sum - 8);

}

function coinsupdate(){
  //収穫してコインを増やす
  for(let i = 0;i < ynum;i++)for(let j = 0;j < xnum;j++){
    if(lands[i][j].state == landstate.field){
      if(lands[i][j].harvestpoint >= lands[i][j].harvestable){
        coins.coincnt+= 1;
        lands[i][j].harvestpoint = 0;
      }
    }
  }
}

