function drawlands_and_update_status(){
  //マス目の描画ついでにマス目の状態更新
  
  //周りの白色の部分
  fill(255);
  rect(lands_area.lands_left_top_x,lands_area.lands_left_top_y,lands_area.landsW,lands_area.landsH);

  //それぞれの土地の部分
  for(let i = 0;i < ynum;i++){
    for(let j = 0;j < xnum;j++){
      if(lands[i][j].state == landstate.tree){
        //木の描画
        drawtree(i,j);
        lands[i][j].stateupdate();
      }else if(lands[i][j].state == landstate.fire){
        //火の描画
        drawfiretree(i,j);
        let ret = lands[i][j].stateupdate();
        if(ret){
          let minx = lands[i][j].minx;let maxx = lands[i][j].maxx;
          let miny = lands[i][j].miny;let maxy = lands[i][j].maxy; 
          lands[i][j] = new Field(minx,maxx,miny,maxy,1);
        }
      }else{
        //土地の描画
        drawfield(i,j);
        lands[i][j].stateupdate();
      }

    }
  }
}

function mouseaction(){
  //マウスのクリックによって耕地森林の状態を変化させたりリスタートできるようにする  
  if(started == false){
    //始める処理
    if(0 <= mouseX && mouseX < width && 0 <= mouseY && mouseY < height){
      started = true;
      restart();
    }
    return ;
  }

  if(isfinish){
    if(!(0 <= mouseX && mouseX < width && 0 <= mouseY && mouseY < height))return ;
    //今は右半分ならリスタート
    //左半分ならニュース
    if(mouseX <= width/2){
      restart();
    }else{
      redirectToresult(news_type);
    }
    
  }else{
    //押されたのが森林か農地だったら
    console.log(mouseX,mouseY);
    let fin = false;
    for(let i = 0;i < ynum;i++)for(let j = 0;j < xnum;j++){
      let pos = lands[i][j].position();
      if(pos.minx <= mouseX && mouseX < pos.maxx
        && pos.miny <= mouseY && mouseY < pos.maxy){
          fin = true;
          if(lands[i][j].state == landstate.tree){
            //火をつける
            lands[i][j] = new Fire(pos.minx,pos.maxx,pos.miny,pos.maxy,1,lands[i][j].level);
            fire_tutrial = false;
          }else if(lands[i][j].state == landstate.field){
            //植林
            lands[i][j] = new Tree(pos.minx,pos.maxx,pos.miny,pos.maxy,1/lands[i][j].level);
            planting_tutrial = false;
          }
      }
    }
    if(fin)return ;
    //それ以外のとこおいたらコイン使ってHP回復
    if(0 <= mouseX && mouseX < width && 0 <= mouseY && mouseY < height){
      if(coins.coincnt >= 1){
        coins.coincnt -= 1;
        hp.hp += 20;
        coin_tutrial = false;
      }
    }
  }

}

function mousePressed(){
  mouseaction();
}

function judge_isfinished(){
  //ゲームオーバーかどうかを判定する
  if(hp.hp <= 0 || oxgen.oxgen <= 0){
    if(isfinish == false){
      //終わった瞬間の時間を記録しておく
      isfinish = true;
      endtime = millis();
    }
    if(hp.hp <= 0){
      news_type = "poverty";
    }else if(oxgen.oxgen <= 0){
      news_type = "environment";
    }else{
      console.log("error");
    }
    if(hp.hp <= 0){
      news_type = "poverty";
    }else if(oxgen.oxgen <= 0){
      news_type = "environment";
    }else{
      console.log("error");
    }
  }
}

