function tutrial(){
  let nowtime = millis();
  console.log(floor(nowtime - starttime) /1000);
  if((floor(nowtime - starttime)) % 1500 >= 1000){
    //点滅させるための処理
    return ;
  }
  if(coin_tutrial == true){
    //コインのところに手を置く
    image(handimg,width/6 + width/30,height/2 + height/3,width/20,width/20);
  }else if(planting_tutrial == true){
    //畑のところに手を置く
    for(let i = 0;i < ynum;i++){
      for(let j = 0;j < xnum;j++){
        if(lands[i][j].state == landstate.field){
          let px = (lands[i][j].minx + lands[i][j].maxx)/2;
          let py = (lands[i][j].miny + lands[i][j].maxy)/2;
          image(handimg,px,py,width/20,width/20);
        }
      }
    }
    
  }else if(fire_tutrial == true){
    //木のところに手を置く
    for(let i = 0;i < ynum;i++){
      for(let j = 0;j < xnum;j++){
        if(lands[i][j].state == landstate.tree){
          let px = (lands[i][j].minx + lands[i][j].maxx)/2;
          let py = (lands[i][j].miny + lands[i][j].maxy)/2;
          image(handimg,px,py,width/20,width/20);
        }
      }
    }
  }
}

